One thing that is annoying with this CI configuration is that some git large files take too long to execute. Fortunately there is a solution for this, which is to cache the Git Large File by adding this script after the checkout action, actions/checkout@v2: - name: Create LFS file list run: git lfs ls-files -l | cut -d' ' -f1 | sort > .lfs-assets-id
- name: Restore LFS cache uses: actions/cache@v2 id: lfs-cache with: path: .git/lfs key: ${{ runner.os }}-lfs-${{ hashFiles('.lfs-assets-id') }}
- name: Git LFS Pull run: | git lfs pull git add . git reset --hard And the complete script is: name: CI on: push: branches: [ main ] pull_request: branches: [ main ] workflow_dispatch: jobs: testAllModes: name: Test in ${{ matrix.testMode }} runs-on: ubuntu-latest strategy: fail-fast: false matrix: testMode: - playmode - editmode steps: - name: Checkout code uses: actions/checkout@v2 with: lfs: true - name: Create LFS file list run: git lfs ls-files -l | cut -d' ' -f1 | sort > .lfs-assets-id - name: Restore LFS cache uses: actions/cache@v2 id: lfs-cache with: path: .git/lfs key: ${{ runner.os }}-lfs-${{ hashFiles('.lfs-assets-id') }} - name: Git LFS Pull run: | git lfs pull git add . git reset --hard - name: Cache Library uses: actions/cache@v2 with: path: Library key: Library-Test restore-keys: | Library- - name: Run test ${{ matrix.testMode }} uses: game-ci/unity-test-runner@v2 id: tests env: UNITY_LICENSE: ${{ secrets.UNITY_LICENSE }} with: testMode: ${{ matrix.testMode }} artifactsPath: ${{ matrix.testMode }}-artifacts githubToken: ${{ secrets.GITHUB_TOKEN }} checkName: ${{ matrix.testMode }} Test Results - name: Upload artifact for test in ${{ matrix.testMode }} uses: actions/upload-artifact@v2 if: always() with: name: Test results for ${{ matrix.testMode }} path: ${{ steps.tests.outputs.artifactsPath }} build: name: Build - ${{ matrix.targetPlatform }} runs-on: ubuntu-latest strategy: fail-fast: false matrix: targetPlatform: - StandaloneOSX - WebGL steps: - name: Checkout code uses: actions/checkout@v2 - name: Create LFS file list run: git lfs ls-files -l | cut -d' ' -f1 | sort > .lfs-assets-id - name: Restore LFS cache uses: actions/cache@v2 id: lfs-cache with: path: .git/lfs key: ${{ runner.os }}-lfs-${{ hashFiles('.lfs-assets-id') }} - name: Git LFS Pull run: | git lfs pull git add . git reset --hard - name: Cache Library uses: actions/cache@v2 with: path: Library key: Library-${{ matrix.targetPlatform }} restore-keys: Library- - name: Build for ${{ matrix.targetPlatform }} uses: game-ci/unity-builder@v2 env: UNITY_LICENSE: ${{ secrets.UNITY_LICENSE }} with: targetPlatform: ${{ matrix.targetPlatform }} Note that I have added names for each step.
